import { defineStore } from 'pinia'

export const useManageStore = defineStore('manage', {
  state: () => ({
    manageList: [
      {
        // 作品编号
        id: 1,
        //作品名称
        workName: '作品名称',
        //作品大分类
        workCategory: '软件应用与开发',
        //作品小分类
        workSubCategory: 'Web 应用与开发',
        //作品描述
        workDescription: '作品描述',
        // 学校
        school: '学校',
        // 作品状态
        workStatus: 1,
        // 作品学生组
        workStudentGroup: [
          {
            name: '张三',
            studentId: '201811111111',
            username: 'zhangsan',
            grade: '软件1801',
            major: '软件工程',
            education: '本科',
            email: '1213770427@qq.com',
            phoneNumber: '13078901234',
            //证件类型
            idType: '身份证',
            //证件号码
            idNumber: '111111111111111111',
            // 学生证件照
            avatar:
              'data:image/jpeg;base64,',
            // 入学年费
            admissionYear: '2018',
            // 毕业年份
            graduationYear: '2022',
            // 学校
            school: '华南理工大学'
          }
        ],
        // 作品教师组
        workTeacherGroup: [
          {
            name: '李四',
            employeeId: '1',
            username: '王五',
            email: '1213770427@qq.com',
            phoneNumber: '13078901234',
            title: '教授',
            isJudge: 1,
            //学校
            school: '清华大学',
            //学院
            college: '计算机学院',
            // 证件类型
            idType: '身份证',
            // 证件号码
            idNumber: '123456789012345678',
            // 照片
            avatar:
              'data:image/jpeg;base64,'
          }
        ]
      }
    ]
  }),
  actions: {
    // 获取管理列表
    getManageList() {
      const manageList = localStorage.getItem('manageList')
      if (manageList) {
        this.manageList = JSON.parse(manageList)
        return this.manageList
      } else {
        return this.manageList
      }
    },
    localManageList() {
      localStorage.setItem('manageList', JSON.stringify(this.manageList))
    },
    // 添加管理
    addManage(newManageData) {
      this.manageList.push(newManageData)
      this.localManageList()
    },
    // 删除管理
    deleteManage(id) {
      this.manageList = this.manageList.filter((item) => item.id !== id)
      this.localManageList()
    },
    // 修改管理
    editManage(editManageData) {
      this.manageList = this.manageList.map((item) => {
        if (item.id === editManageData.id) {
          return editManageData
        } else {
          return item
        }
      })
      this.localManageList()
    }
  }
})
